$primary: #03F7EE;
$secondary: #AB2346;
$tertiary: #232ED1;

//Standard colors
$dark: #0D1317;
$light: #FFFFFF;
$card-back: #333;
$shadow: rgba(0, 0, 0, 0.2);
$line: #545581;

//Font family and weights
