//Make service look like a card
.service {
  position: relative;
  top: 0;
  background-color: $card-back;
  height: 65vh;
  border-radius: 6px;
  padding: 2rem;
  color: $light;
  box-shadow: 0 .25rem .25rem $shadow, 0 0 1rem $shadow;
  overflow: hidden;
  transition: top ease 0.5s;

  //Moves up on hover
  &:hover {
    top: -10px;
  }

  //Makes image fit correctly
  .image-container {
    margin: -2rem -2rem 1rem -2rem;

    img {
      width: 100%;
      height: 40vh;
      opacity: 0;
      animation: ImageFadeIn .8s 1.4s forwards;
    }
  }

  //Creates wavy divider
  svg {
    position: absolute;
    left: 0;
    top: 40px;

    .line {
      opacity: 0;
      animation: LineFadeIn .8s .8s forwards ease-in;
    }
  }

  //Positions card content
  .content {
    margin-top: -2rem;
    opacity: 0;
    animation: ContentFadeIn .8s 1.6s forwards;

    .title {
      color: $light;
      margin-top: 0;
      font-weight: $bold-font;
      letter-spacing: 0.01em;
    }
  }  
}


//Image divider fade in
@keyframes LineFadeIn {
  0% { 
    opacity: 0; 
    d: path("M 0 300 Q 0 300 0 300 Q 0 300 0 300 C 0 300 0 300 0 300 Q 0 300 0 300 "); 
    stroke: $light; 
  }
  50% { 
    opacity: 1; 
    d: path("M 0 300 Q 50 300 100 300 Q 250 300 350 300 C 350 300 500 300 650 300 Q 750 300 800 300"); 
    stroke: $line; 
  }
  100% { 
    opacity: 1; 
    d: path("M -2 100 Q 50 200 100 250 Q 250 400 350 300 C 400 250 550 150 650 300 Q 750 450 802 400"); 
    stroke: $line; }
}


//Title and content fade in
@keyframes ContentFadeIn {
  0% { 
    transform: translateY(-1rem); 
    opacity: 0; 
  }
  100% { 
    transform: translateY(0); 
    opacity: 1; 
  }
}


//Service imag fade in
@keyframes ImageFadeIn {
  0% { 
    transform: translate(-.5rem, -.5rem) scale(1.05); 
    opacity: 0; 
    filter: blur(2px); 
  }
  50% { 
    opacity: 1; 
    filter: blur(2px); 
  }
  100% { 
    transform: translateY(0) scale(1.0); 
    opacity: 1; 
    filter: blur(0); 
  }
}

